import React from 'react';
import './App.css';
import Navbar from './components/Navbar';
import { BrowserRouter as Router, Routes, Route}
    from 'react-router-dom';
import Home from './pages';
import Espace_administration from './Pages/Espace Administration/Espace_admistration';
import Espace_jurys from './Pages/Espace Jurys/Espace_Jurys.js';
import Espace_superviseur from './Pages/Espace Superviseur/Espace_Superviseur';


function App() {
return (
    <Router>
    <Navbar />
    <Routes>
        <Route exact path='/' element={<Home />} />
        <Route path='/administration' element={<Espace_administration/>} />
        <Route path='/jurys' element={<Espace_jurys/>} />
        <Route path='/superviseur' element={<Espace_superviseur/>} />

    </Routes>
    </Router>
);
}

export default App;
